import Example from '.components/Main'

class App extends React.Component {
	render() {
		return (<div className="App">

			<Greet name='Abisek' desc='fuck you'>
				<p>Badhia Badhia</p>
			</Greet>

			<br/>

			<JustForFun/>

			<br/>

			<Welcome name="Soumya" desc="chutiya"/>

			<Example/>
		</div>);
	}

}

export default App;

